package strings;

public class Empty {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s1 = "";
		String s2 = "Navya";
		if(s1.isEmpty()) {
			System.out.println("s1 is Empty");
		}
		else {
			System.out.println(s1);
		}
		if(s2.isEmpty()) {
			System.out.println("s2 is Empty");
		}else {
			System.out.println(s2);
		}
	}

}
